import { Link } from 'react-router-dom';

const Instructions = () => {
  return (
    <div>
      <h1>Instructions</h1>
      <p>Welcome to the instructions page!</p>
      <Link to="/task1"><button>Start</button></Link>
    </div>
  );
};

export default Instructions;
